#include "algorithms.h"
#include "common.h"

class Solution {
  public:
    int maximumScore(vector<int> &nums, int k) {
        const long long MOD = 1e9 + 7;
        int n = nums.size();

        int maxelem = *max_element(nums.begin(), nums.end());

        auto primes = sieveOfEratosthenes(maxelem);

        vector<int> numsPrimes(n, 0);
        for (int i = 0; i < n; i++) {
            if (nums[i] < 2) {
                continue;
            }
            numsPrimes[i] = countPrimes(nums[i], primes);
        }

        vector<int> numsWindows(n, 0);
        for (int i = 0; i < n; i++) {
            int numPrimes = numsPrimes[i];
            int windowCountToTheRight = 1;
            int left = i, right = i + 1;
            while (right < n && numPrimes >= numsPrimes[right]) {
                windowCountToTheRight++;
                right++;
            }
            numsWindows[i] = windowCountToTheRight;
            left--;
            while (left >= 0 && numPrimes > numsPrimes[left]) {
                numsWindows[i] += windowCountToTheRight;
                left--;
            }
        }

        vector<pair<int, int>> sortedNums(n, {0, 0});
        for (int i = 0; i < n; i++) {
            sortedNums[i] = {nums[i], numsWindows[i]};
        }
        sort(sortedNums.begin(), sortedNums.end(), greater<>());

        long long maxScore = 1;
        int index = 0;
        while (k > 0) {
            auto [num, windows] = sortedNums[index];
            long long mp = modpow(num, min(windows, k), MOD);
            maxScore = (maxScore * mp) % MOD;
            k -= windows;
            index++;
        }

        return maxScore;
    }

    int countPrimes(int num, vector<bool> &primes) {
        int count = 0;
        int prime = 2;
        while (prime < primes.size() && num > 1) {
            bool found = false;
            while (num % prime == 0) {
                num /= prime;
                found = true;
            }
            if (found) {
                count++;
            }
            prime++;
            while (prime < primes.size() && !primes[prime]) {
                prime++;
            }
        }
        return count;
    }

    long long modpow(long long base, long long exp, long long modulus) {
        long long res = 1;
        base = base % modulus;
        if (base == 0)
            return 0;
        while (exp > 0) {
            if (exp & 1)
                res = (res * base) % modulus;
            exp = exp >> 1; // y = y/2
            base = (base * base) % modulus;
        }
        return res;
    }
};

